import React, { useState } from "react";
import { Container } from "./ExpertiseStyles";


function MyExpertise() {
    const [company, setCompany] = useState([
        {
            "name" : "Ray",
            "age" : 19,
            "University" : "UB"
        },
        {
            "name" : "Millan",
            "age" : 59,
            "University" : "PB"
        }
    ]);
    return (

        <Container>
            <h1></h1>
            <div>
                Hi,
                {company.map((person) => {
                    <><p>{person.name}</p><p>{person.age}</p></>
                })}
            </div>
        </Container>
    )
}

export default MyExpertise;
